	 "Twin Gates of Transcendence" : {"id":281,"name":"Twin Gates of Transcendence","desc":"You now <b>keep making cookies while the game is closed</b>, at the rate of <b>5%</b> of your regular CpS and up to <b>1 hour</b> after the game is closed.<br>(Beyond 1 hour, this is reduced by a further 90% - your rate goes down to <b>0.5%</b> of your CpS.)<q>This is one occasion you're always underdressed for. Don't worry, just rush in past the bouncer and pretend you know people.</q>","price":1,"icon":[15,11],"pool":"prestige","tier":0,"order":281},
