	 "Fudge fungus" : {"id":295,"name":"Fudge fungus","desc":"Farms are <b>twice</b> as efficient.<q>A sugary parasite whose tendrils help cookie growth.<br>Please do not breathe in the spores. In case of spore ingestion, seek medical help within the next 36 seconds.</q>","price":550000000000000,"icon":[2,16],"pool":"","tier":7,"order":300.295},
	 "Planetsplitters" : {"id":296,"name":"Planetsplitters","desc":"Mines are <b>twice</b> as efficient.<q>These new state-of-the-art excavators have been tested on Merula, Globort and Flwanza VI, among other distant planets which have been curiously quiet lately.</q>","price":6000000000000000,"icon":[3,16],"pool":"","tier":7,"order":400.296},
	 "Cyborg workforce" : {"id":297,"name":"Cyborg workforce","desc":"Factories are <b>twice</b> as efficient.<q>Semi-synthetic organisms don't slack off, don't unionize, and have 20% shorter lunch breaks, making them ideal labor fodder.</q>","price":65000000000000000,"icon":[4,16],"pool":"","tier":7,"order":500.297},
	 "Way of the wallet" : {"id":298,"name":"Way of the wallet","desc":"Banks are <b>twice</b> as efficient.<q>This new monetary school of thought is all the rage on the banking scene; follow its precepts and you may just profit from it.</q>","price":700000000000000000,"icon":[15,16],"pool":"","tier":7,"order":525.298},
	 "Creation myth" : {"id":299,"name":"Creation myth","desc":"Temples are <b>twice</b> as efficient.<q>Stories have been circulating about the origins of the very first cookie that was ever baked; tales of how it all began, in the Dough beyond time and the Ovens of destiny.</q>","price":10000000000000000000,"icon":[16,16],"pool":"","tier":7,"order":550.299},
	 "Cookiemancy" : {"id":300,"name":"Cookiemancy","desc":"Wizard towers are <b>twice</b> as efficient.<q>There it is; the perfected school of baking magic. From summoning chips to hexing nuts, there is not a single part of cookie-making that hasn't been improved tenfold by magic tricks.</q>","price":165000000000000000000,"icon":[17,16],"pool":"","tier":7,"order":575.3},
	 "Dyson sphere" : {"id":301,"name":"Dyson sphere","desc":"Shipments are <b>twice</b> as efficient.<q>You've found a way to apply your knowledge of cosmic technology to slightly more local endeavors; this gigantic sphere of meta-materials, wrapping the solar system, is sure to kick your baking abilities up a notch.</q>","price":2.55e+21,"icon":[5,16],"pool":"","tier":7,"order":600.301},
	 "Theory of atomic fluidity" : {"id":302,"name":"Theory of atomic fluidity","desc":"Alchemy labs are <b>twice</b> as efficient.<q>Pushing alchemy to its most extreme limits, you find that everything is transmutable into anything else - lead to gold, mercury to water; more importantly, you realize that anything can -and should- be converted to cookies.</q>","price":3.75e+22,"icon":[6,16],"pool":"","tier":7,"order":700.302},
	 "End of times back-up plan" : {"id":303,"name":"End of times back-up plan","desc":"Portals are <b>twice</b> as efficient.<q>Just in case, alright?</q>","price":5e+23,"icon":[7,16],"pool":"","tier":7,"order":800.303},
	 "Great loop hypothesis" : {"id":304,"name":"Great loop hypothesis","desc":"Time machines are <b>twice</b> as efficient.<q>What if our universe is just one instance of an infinite cycle? What if, before and after it, stretched infinite amounts of the same universe, themselves containing infinite amounts of cookies?</q>","price":7e+24,"icon":[8,16],"pool":"","tier":7,"order":900.304},
	 "The Pulse" : {"id":305,"name":"The Pulse","desc":"Antimatter condensers are <b>twice</b> as efficient.<q>You've tapped into the very pulse of the cosmos, a timeless rhythm along which every material and antimaterial thing beats in unison. This, somehow, means more cookies.</q>","price":8.5e+25,"icon":[13,16],"pool":"","tier":7,"order":1000.305},
	 "Lux sanctorum" : {"id":306,"name":"Lux sanctorum","desc":"Prisms are <b>twice</b> as efficient.<q>Your prism attendants have become increasingly mesmerized with something in the light - or maybe something beyond it; beyond us all, perhaps?</q>","price":1.05e+27,"icon":[14,16],"pool":"","tier":7,"order":1100.306},
	 "The Unbridling" : {"id":307,"name":"The Unbridling","desc":"Grandmas are <b>twice</b> as efficient.<q>It might be a classic tale of bad parenting, but let's see where grandma is going with this.</q>","price":50000000000000000,"icon":[1,17],"pool":"","tier":8,"order":200.307},
	 "Wheat triffids" : {"id":308,"name":"Wheat triffids","desc":"Farms are <b>twice</b> as efficient.<q>Taking care of crops is so much easier when your plants can just walk about and help around the farm.<br>Do not pet. Do not feed. Do not attempt to converse with.</q>","price":550000000000000000,"icon":[2,17],"pool":"","tier":8,"order":300.308},
	 "Canola oil wells" : {"id":309,"name":"Canola oil wells","desc":"Mines are <b>twice</b> as efficient.<q>A previously untapped resource, canola oil permeates the underground olifers which grant it its particular taste and lucrative properties.</q>","price":6000000000000000000,"icon":[3,17],"pool":"","tier":8,"order":400.309},
