	 "Theocracy" : {"id":312,"name":"Theocracy","desc":"Temples are <b>twice</b> as efficient.<q>You've turned your cookie empire into a perfect theocracy, gathering the adoration of zillions of followers from every corner of the universe.<br>Don't let it go to your head.</q>","price":1e+22,"icon":[16,17],"pool":"","tier":8,"order":550.312},
	 "Rabbit trick" : {"id":313,"name":"Rabbit trick","desc":"Wizard towers are <b>twice</b> as efficient.<q>Using nothing more than a fancy top hat, your wizards have found a way to simultaneously curb rabbit population and produce heaps of extra cookies for basically free!<br>Resulting cookies may or may not be fit for vegans.</q>","price":1.65e+23,"icon":[17,17],"pool":"","tier":8,"order":575.313},
