	 "Kruidnoten" : {"id":607,"name":"Kruidnoten","desc":"Cookie production multiplier <b>+5%</b>.<q>A festive dutch favorite; tiny cinnamony bites sometimes coated in chocolate. The name translates roughly to \"kruidnoten\".</q>","price":3.1622776601683793e+49,"icon":[30,3],"pool":"cookie","tier":0,"order":10020.607},
