	 "Dragon scale" : {"id":648,"name":"Dragon scale","desc":"Cookie production multiplier <b>+3%</b>.<br>Cost scales with CpS, but 10 times cheaper with a fully-trained dragon.<q>Your dragon sheds these regularly, so this one probably won't be missed.<br>Note: icon not to scale.</q>","price":999,"icon":[30,14],"pool":"","tier":0,"order":25100.648},
